INSERT INTO `blog` (`blog_id`, `title`, `body`, `category_id`, `image`, `created_at`, `update_at`, `account_id`) VALUES
(102, 'Why Everyone Should Learn PHP', '<h3>Why Learn PHP?</h3>\r\n\r\n<p>PHP is a widely used server-side programming language that&rsquo;s become increasingly fast and powerful over the years. PHP works well with HTML and databases, making it a great language for anyone interested in building dynamic web applications.</p>\r\n\r\n<h3>Take-Away Skills</h3>\r\n\r\n<p>In this course, you&rsquo;ll be exposed to fundamental programming concepts in PHP.</p>\r\n\r\n<h3>Note on Prerequisites:</h3>\r\n\r\n<p>Some basic HTML is helpful before taking this course.</p>\r\n', 4, , '2022-04-08 12:00:18', '2022-04-08 02:00:18', 106),
(103, '7 benefits of learning HTML', '<p>Wondering if you should learn HTML? If you&#39;re interested in designing websites, the answer&#39;s a resounding yes!&nbsp;HTML&nbsp;is one of the cornerstones of&nbsp;web development, as developers use&nbsp;<a href=\"https://www.codecademy.com/resources/blog/what-is-html/\">i</a>t to structure a website&#39;s content. Essentially, it&#39;s the code that dictates where all the website elements are and how they appear to the user.<br />\r\n&nbsp;</p>\r\n\r\n<h3>1. HTML can help you build your own unique website</h3>\r\n\r\n<p>There are plenty of beautiful website templates on sites that let you build your own, using elements and an easy-to-use drag-and-drop system. But, if your goal is to have a website that stands out from the crowd, you&#39;re going to be glad you learned HTML.</p>\r\n\r\n<p>HTML allows you to customize your website or build your theme from scratch. It also allows you to create and organize the elements of your website, like images, text, tables, or forms.</p>\r\n\r\n<h3>2. You&#39;ll no longer have to wait for your IT team</h3>\r\n\r\n<p>Do you have to reach out to your IT team any time there&#39;s a typo on your company&#39;s website or newsletter? If so, you might have found that it took a while for them to get your request as they&#39;re often busy with other projects.</p>\r\n\r\n<p>With HTML, you could spearhead these improvements and fix errors as you find them. It&#39;s also a great way to impress your boss, as they&#39;ll likely be thrilled to hear that you learned a new skill and took the initiative to help the company.</p>\r\n\r\n<h3>3. HTML helps you understand how to make things more accessible</h3>\r\n\r\n<p>Semantic HTML tags form the basis for good accessibility practices, as they allow screen readers to determine where different elements are on a web page and how they&#39;re formatted.</p>\r\n\r\n<p>Learning how to make your website accessible is crucial. Not only does it help maximize your audience, but it&#39;ll also help demonstrate that your company values inclusivity. In another post, we take a closer look at&nbsp;why accessibility is so important.</p>\r\n\r\n<h3>4. Knowing HTML helps you collaborate more effectively with technical teams</h3>\r\n\r\n<p>If you&#39;re a project manager, copywriter, or instructional designer, you likely work with developers quite often. Learning HTML is a great step if you&#39;re looking to collaborate more effectively with your technical teammates.</p>\r\n\r\n<p>Basically, being familiar with HTML helps ensure that you and your technical teammates are on the same page. This helps save time and streamline communications as you&#39;ll have a better understanding of what it&#39;d require to implement your new ideas.</p>\r\n\r\n<h3>5. Your designs can shine with HTML</h3>\r\n\r\n<p>Maybe your skills and desired career lie more on the design side of website development. If you want to showcase how your graphics or layouts might look for a client, knowing a little HTML will help.</p>\r\n\r\n<p>You don&#39;t need to be a pro to put HTML to good use. Even with just the basics, you can create mock-up designs to illustrate your ideas to your clients. This will also help you save time you&#39;d otherwise spend editing your design, as you&#39;ll be able to get feedback on your project sooner.</p>\r\n\r\n<h3>6. HTML skills will open up more income-generating opportunities</h3>\r\n\r\n<p>As you can see, HTML is a valuable skill &mdash; even for non-technical professionals. Still, it&#39;s also a great choice if you&#39;re looking to switch careers or venture into freelance development.&nbsp;Front-end engineers&nbsp;are highly in demand, and HTML is a core component of their skillset, so you&#39;ll want to learn it if you&#39;re considering entering the field.</p>\r\n\r\n<h3>7. HTML can help you to learn other coding languages easier</h3>\r\n\r\n<p>Learning how to code can be difficult. When you&#39;re just starting out, it&#39;s easy to get intimidated by complicated syntax and various functions and methods. For many, it helps to start with a programming language that&#39;s relatively easy to learn.</p>\r\n', 5, , '2022-04-08 12:02:49', '2022-04-08 02:02:49', 106);
INSERT INTO `blog` (`blog_id`, `title`, `body`, `category_id`, `image`, `created_at`, `update_at`, `account_id`) VALUES
(104, '5 Reasons to Start Programming With Python', '<h2>What Is Python?&nbsp;</h2>\r\n\r\n<p>Python is a general-purpose programming language, which means that, unlike JavaScript, HTML, and CSS, it can be used in applications beyond web development. Though it&rsquo;s been around for 30 years, it has recently become one of the most popular programming languages, and its popularity continues to grow.</p>\r\n\r\n<h2>1. Python Is Beginner-Friendly</h2>\r\n\r\n<p>Why learn Python? For starters, the language is an excellent place to begin if you&rsquo;re new to coding. One of the biggest hurdles for aspiring coders is the daunting task of learning a new language that looks nothing like what they&rsquo;re used to reading and writing. However, Python features English syntax and was designed to be&nbsp;concise and easy to read&nbsp;&mdash; all of which makes it more accessible to first-time coders than many other languages.&nbsp;</p>\r\n\r\n<p>Python is also easy to learn because it is an interpreted programming language. This means that you can run each line of code once you have finished writing it, allowing you to immediately check it and make adjustments if needed &mdash; a big help to those who are still learning and a time-saver for coders everywhere.&nbsp;</p>\r\n\r\n<h2>2. Python Is Versatile&nbsp;</h2>\r\n\r\n<p>Python is highly versatile. You can use it for both small and complex tasks, and it is used across many different industries &mdash; from its more common applications in data science and software engineering to environments like mobile app development, artificial intelligence, and machine learning. This multifaceted use is due to the wide array of Python&nbsp;libraries&nbsp;available (over 125,000, to be specific). Libraries are collections of pre-written code in a particular language that anyone can access, meaning that once you&rsquo;ve learned the basics of Python, you&rsquo;ll likely be able to understand and use a huge amount of code developed by other programmers.</p>\r\n\r\n<p>Another important aspect of Python&rsquo;s versatility is its ability to run with other programming languages.&nbsp;A few common examples&nbsp;of Python implementation with other languages are Jython (Python integrated with Java) and CPython (Python integrated with C). Lastly, Python offers cross-platform functionality, meaning that it will function properly whether you&rsquo;re working with Windows, Linux, or macOS.</p>\r\n\r\n<h2>3. Python Developer Roles Are in High Demand&nbsp;</h2>\r\n\r\n<p>Python developer roles are in high demand, as many major companies &mdash; including DropBox, Netflix, and Facebook &mdash; use it. Google has even made its own&nbsp;Python style guide. Python developer jobs are also comparatively lucrative. According to&nbsp;Indeed<a href=\"https://techbootcamps.utexas.edu/blog/why-learn-python-get-started-programming/#disclaimer\">*</a>, Python developers earn an average salary of $108,391, which makes it the fourth-most lucrative programming language&nbsp;behind Ruby ($120,174), C++ ($114,000), and JavaScript ($111,623). Python developers also have the opportunity to earn a high salary with less experience, according to&nbsp;StackOverflow.</p>\r\n\r\n<h2>4. Python Boasts a Supportive Community</h2>\r\n\r\n<p>When you&rsquo;re learning a new programming language &mdash; particularly after you&rsquo;ve completed your bootcamp course or degree &mdash; you&rsquo;ll want to feel confident that you have a community of programmers you can turn to with questions when an issue comes up. One major benefit of Python is its robust and supportive online community, as evidenced by the&nbsp;1.5 Million GitHub repositories&nbsp;that make Python the platform&rsquo;s second-largest community. Python also has its own network of&nbsp;robust community forums, where users can discuss everything from workflow to software development, and Python users often organize&nbsp;meetups&nbsp;around the world to build community and knowledge bases.</p>\r\n\r\n<h2>5. Python Is the Fastest-Growing Programming Language&nbsp;</h2>\r\n\r\n<p>When it comes to Python&rsquo;s popularity and growth rate, the numbers don&rsquo;t lie. According to the&nbsp;PYPL PopularitY of Programming Language Index, Python is the most-searched programming language on the internet &mdash; and that doesn&rsquo;t look like it will be changing any time soon. According to&nbsp;Stack Overflow, Python is also the fastest-growing programming language, and&nbsp;TIOBE&nbsp;gave it the 2020 Programming Language of the Year award as it gained popularity faster than any other language. Part of this acclaim is due to Python&rsquo;s usefulness in the world of data science; as fields like machine learning, data modeling, and AI grow, so too does the demand for Python-related skills. All of this means that, if you&rsquo;re looking for a new programming language to learn &mdash; or looking to transition into the field of programming &mdash; Python is a wise choice.</p>\r\n', 1, , '2022-04-07 18:08:27', '2022-04-08 02:08:27', 107);
INSERT INTO `blog` (`blog_id`, `title`, `body`, `category_id`, `image`, `created_at`, `update_at`, `account_id`) VALUES
(105, '7 Reasons to Learn Java Programming', '<p><strong>1. Java is a popular, widely used programming language</strong></p>\r\n\r\n<p>From web to mobile to desktop, Java is found in virtually all operating systems. Used commonly along with business applications and Android mobile operating systems, the Java programming language is constantly updated to keep up with industry trends and can support many languages across its platform.</p>\r\n\r\n<p><strong>2. Java is easy to learn</strong></p>\r\n\r\n<p>Java was designed to be beginner-friendly, creating a safe environment for new developers to play with the language and make mistakes. While it is simple to use, Java is a diverse and high-level language, allowing users to focus on programming rather than more complex machine details. In fact, Java&rsquo;s advanced memory management tools take care of memory allocation, reallocation, and deallocation automatically through a software tool called the Garbage Collector. Additionally, Java has English-like syntax with minimum magic characters, making it easy to read and learn Java programs.</p>\r\n\r\n<p><strong>3. Java is a solid precursor to other programming languages</strong></p>\r\n\r\n<p>For any aspiring programmer, the benefits of learning Java are foundational to learning subsequent coding languages such as C, C#, C++, Python and others. This is because Java teaches new coders how to think like a programmer, working through processes with logic and testing out ideas. It&rsquo;s no wonder, then, that Java is often the most common coding language taught in many Computer Science programs.</p>\r\n\r\n<p><strong>4. Java is versatile</strong></p>\r\n\r\n<p>Not only is Java universally used in tech, but it is easily scalable and most importantly, highly portable, as it must be executed through a cross-platform compatible Java Virtual Machine (JVM). This JVM sends appropriate platform specific instructions to your computer, meaning if a developer writes code once it can easily be transferred to another system on practically any computing device. Java also enables developers to create software on modern application pillars which are secure, robust, and scalable, making Java a versatile choice for computers, applications, gaming consoles, and more. It&rsquo;s no wonder Java is well known as the &ldquo;write once, run anywhere&rdquo; programming language.</p>\r\n\r\n<p><strong>5. Java developers have community support</strong></p>\r\n\r\n<p>Need help? The Java community has you covered. Java has active forums, open-source libraries, and Java user groups for every skill level. Thanks to its long-standing popularity, most Java problems have already been solved, with any question imaginable asked, tested, answered, and posted online in one of the many programmer communities. Java&rsquo;s staying power also means it&rsquo;s easy to connect with other passionate and knowledgeable Java programmers via social media, meetups, subreddits, and other online support and networking communities.</p>\r\n\r\n<p><strong>6. Java developers&nbsp;earn high wages</strong></p>\r\n\r\n<p>Software developer roles are expected to&nbsp;grow by 22% over the next decade, with backend developers in high demand thanks to their specialized skill set. Further, the nationwide&nbsp;average base salary&nbsp;for backend developers sits at $80,000 &ndash; 54% more than the&nbsp;median income&nbsp;in the United States. These statistics bode well for Java Developers, who are some of the highest paid programmers in the industry. In fact, Java Developers today&nbsp;make an average of $91,465&nbsp;per year, with salaries remaining competitive with other common language developers.<strong>&nbsp;</strong></p>\r\n\r\n<p><strong>7. Java is here to stay</strong></p>\r\n\r\n<p>The tech landscape is ever changing, with developers looking to learn the hottest new languages and frameworks to give them an edge. While staying current is important, it can also be costly and ultimately unfruitful when industry trends change. Thus, with new languages and technologies coming and going, the importance of Java cannot be overstated. Once programmers learn the Java basics, they can use their skills to specialize in web development, game development, app development and more, not to mention pivot their skills to more easily learn other languages. One thing&rsquo;s for sure &ndash; thanks to its mature tools and libraries, stellar reputation, and entrenchment in the tech industry, Java will remain foundational for the next quarter century and beyond.<strong>&nbsp;</strong></p>\r\n', 2, , '2022-04-07 18:16:27', '2022-04-08 02:16:27', 108),
(106, 'Should You Learn JavaScript? Advice for Newbie Web Developers', '<h2>1. What is JavaScript and what does it do?</h2>\r\n\r\n<p>Before you start learning something new, it&rsquo;s important to understand exactly what it is and what it does. This is especially useful when it comes to mastering a new programming language.</p>\r\n\r\n<p>In simple terms, JavaScript is a programming language used to make websites interactive. If you think about the basic makeup of a website, you have HTML, which describes and defines the basic content and structure of the website, then you have CSS, which tells the browser how this HTML content should be displayed&mdash;determining things like color and font.</p>\r\n\r\n<p>With just HTML and CSS, you have a website that looks good but doesn&rsquo;t actually do much. JavaScript brings the website to life by adding functionality. It&rsquo;s is responsible for elements that the user can interact with, such as drop-down menus, modal windows, and contact forms. It is also used to create things like animations, video players, and interactive maps.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>2. Is it still worth learning JavaScript in 2022?</h2>\r\n\r\n<p>The world of web development is constantly moving. With so many new tools popping up all the time, it can be extremely difficult to know where you should focus your efforts. As an aspiring developer, you&rsquo;ll want to make sure that what you&rsquo;re learning is still relevant in today&rsquo;s industry.</p>\r\n\r\n<p>If you&rsquo;re having doubts about this language, don&rsquo;t. It&rsquo;s important to note that since its creation in 1995 JavaScript is pretty much everywhere on the web&mdash;and that&rsquo;s not likely to change any time soon. According to the&nbsp;2021 StackOverflow developer survey, it&rsquo;s the most commonly used programming language for the ninth year in a row.</p>\r\n\r\n<p>It is currently used by 94.5% of all websites and, despite originally being designed as a client-side language, JavaScript has now made its way to the server-side of websites (thanks to Node.js), mobile devices (thanks to React Native and Ionic) and desktop (courtesy of Electron).</p>\r\n', 3, , '2022-04-07 18:21:55', '2022-04-08 02:21:55', 109);

