INSERT INTO `topic` (`topic_id`, `title`, `description`, `video_link`, `resource_link`, `course_id`) VALUES
(5, 'PHP introduction', '<p>- PHP code is executed in the server.<br />\r\n- It can be integrated with many databases such as Oracle, Microsoft - SQL Server, MySQL, PostgreSQL, Sybase, Informix.<br />\r\n- It is powerful to hold a content management system like WordPress and can be used to control user access.<br />\r\n- It supports main protocols like HTTP Basic, HTTP Digest, IMAP, FTP, and others.<br />\r\n- Websites like www.facebook.com, www.yahoo.com are also built on PHP.<br />\r\n- One of the main reasons behind this is that PHP can be easily embedded in HTML files and HTML codes can also be written in a PHP file.<br />\r\n- The thing that differentiates PHP from the client-side language like HTML is, PHP codes are executed on the server whereas HTML codes are directly rendered on the browser. PHP codes are first executed on the server and then the result is returned to the browser.<br />\r\n-The only information that the client or browser knows is the result returned after executing the PHP script on the server and not the actual PHP codes present in the PHP file. Also, PHP files can support other client-side scripting languages like CSS and JavaScript.<br />\r\n-Other characteristics of PHP are as follows.<br />\r\n1. Simple and fast<br />\r\n2. Efficient<br />\r\n3. Secured<br />\r\n4. Flexible<br />\r\n5. Cross-platform, it works with major operating systems like Windows, Linux, MacOS.</p>\r\n', 'https://www.youtube.com/embed/XBj_le81sAc', 'https://www.geeksforgeeks.org/php-introduction/', 102),
(6, 'Learn PHP Full Course', '<p>PHP is the abbreviation of Hypertext Preprocessor and earlier it was abbreviated as Personal Home Page. It is a general-purpose programming language used to design a website or web application. It is the server-side scripting language embedded with HTML to develop Static website, Dynamic website, or Web applications. It was created by Rasmus Lerdorf in 1994. The syntax of PHP is similar to C, C++, and Java. It manages the dynamic content, database, session, cookies, etc of a dynamic website.</p>\r\n\r\n<p>Characteristics of PHP:&nbsp;</p>\r\n\r\n<p>-Open Source: It is an open-source programming language so it can download freely.<br />\r\n-Simplicity: Since PHP does not include libraries like C/C++ so its structure is simple. It contains lots of pre-defined functions to secure your data. Execution of PHP starts from (&lt;?php) and end with closing escape sequence (?&gt;).<br />\r\n-Efficiency: PHP 4.0 uses resource allocation mechanisms and object-oriented programming, in addition to session management features. It eliminates unnecessary memory allocation.<br />\r\n-Security: Many encryption functions are supported by PHP to secure the data.<br />\r\n-Flexibility: It is a very flexible language because it can be embedded with HTML, CSS, JavaScript, XML, and many other languages. Also, the PHP code can be run on any device like Phone, Tabs, Laptops etc.<br />\r\nObject-Oriented: The object-oriented programming features are added in PHP 4.0.</p>\r\n\r\n<p>Advantages of PHP:&nbsp;</p>\r\n\r\n<p>-It is supported by all Operating Systems like Windows, Linux, Unix, etc.<br />\r\n-It is integrated with other programming languages (HTML, CSS, JavaScript, etc) and databased.<br />\r\n-It is easy to connect with the database to store and retrieve data from the database. Multiple databases can also be integrated with PHP.<br />\r\n-It is the fastest programming language compared to other programming languages.<br />\r\n-PHP frameworks and tools are used to protect web applications from outer attacks and security threats.</p>\r\n', 'https://www.youtube.com/embed/OK_JCtrrv-c', 'https://www.geeksforgeeks.org/php-full-form/?ref=lbp', 102),
(7, 'HTML introduction', '<p>HTML stands for HyperText Markup Language. It is used to design web pages using a markup language. HTML is the combination of Hypertext and Markup language. Hypertext defines the link between the web pages. A markup language is used to define the text document within tag which defines the structure of web pages. This language is used to annotate (make notes for the computer) text so that a machine can understand it and manipulate text accordingly. Most markup languages (e.g. HTML) are human-readable. The language uses tags to define what manipulation has to be done on the text.&nbsp;<br />\r\nHTML is a markup language used by the browser to manipulate text, images, and other content, in order to display it in the required format. HTML was created by Tim Berners-Lee in 1991. The first-ever version of HTML was HTML 1.0, but the first standard version was HTML 2.0, published in 1999.</p>\r\n', 'https://www.youtube.com/embed/WwNuvGLblJU', 'https://www.geeksforgeeks.org/html-introduction/?ref=lbp', 103),
(8, 'HTML full course for Beginner', '<p>Characteristics of HTML:</p>\r\n\r\n<p>-Easy to understand: It is the easiest language you can say, very easy to grasp this language and easy to develop.<br />\r\n-Flexibility: This language is so much flexible that you can create whatever you want, a flexible way to design web pages along with the text.<br />\r\n-Linkable: You can make linkable text like users can connect from one page to another page or website through these characteristics.<br />\r\n-Limitless features: You can add videos, gifs, pictures or sound anything you want that will make the website more attractive and understandable.<br />\r\n-Support: You can use this language to display the documents on any platform like Windows, Linux or Mac.<br />\r\nAdvantages of HTML:</p>\r\n\r\n<p>HTML is an easy to learn, easy to apply and it&rsquo;s totally free you will just need a text editor and a browser.<br />\r\nHTML is supported by all the browsers and it is the most friendly search engine.<br />\r\nHTML can easily integrate with other languages and easy to develop.<br />\r\nIt is the basic of all programming languages and the lightest language ever.<br />\r\nIn HTML the display change frequently depending the window size or the device size make it comfortable to read by the user.</p>\r\n', 'https://www.youtube.com/embed/pQN-pnXPaVg', 'https://www.geeksforgeeks.org/html-full-form/?ref=lbp', 103),
(9, 'Python Introduction', '<p>There are two major Python versions: Python 2 and Python 3. Both are quite different.</p>\r\n\r\n<p>Beginning with Python programming:<br />\r\n1) Finding an Interpreter:<br />\r\nBefore we start Python programming, we need to have an interpreter to interpret and run our programs. There are certain online interpreters like https://ide.geeksforgeeks.org/, http://ideone.com/ or http://codepad.org/ that can be used to run Python programs without installing an interpreter.<br />\r\nWindows: There are many interpreters available freely to run Python scripts like IDLE (Integrated Development Environment) that comes bundled with the Python software downloaded from http://python.org/.<br />\r\nLinux: Python comes preinstalled with popular Linux distros such as Ubuntu and Fedora. To check which version of Python you&rsquo;re running, type &ldquo;python&rdquo; in the terminal emulator. The interpreter should start and print the version number.<br />\r\nmacOS: Generally, Python 2.7 comes bundled with macOS. You&rsquo;ll have to manually install Python 3 from http://python.org/.<br />\r\n2) Writing our first program:<br />\r\nJust type in the following code after you start the interpreter.</p>\r\n', 'https://www.youtube.com/embed/Y8Tko2YC5hA', 'https://www.geeksforgeeks.org/python-language-introduction/', 104),
(10, 'Learn Python in One hour', '<p>Below are some facts about Python Programming Language:</p>\r\n\r\n<p>1. Python is currently the most widely used multi-purpose, high-level programming language.<br />\r\n2.Python allows programming in Object-Oriented and Procedural paradigms.<br />\r\n3.Python programs generally are smaller than other programming languages like Java. Programmers have to type relatively less and indentation requirement of the language, makes them readable all the time.<br />\r\n4.Python language is being used by almost all tech-giant companies like &ndash; Google, Amazon, Facebook, Instagram, Dropbox, Uber&hellip; etc.<br />\r\n5.The biggest strength of Python is huge collection of standard library which can be used for the following:<br />\r\n&nbsp;&nbsp; &nbsp;a.Machine Learning<br />\r\n&nbsp;&nbsp; &nbsp;b.GUI Applications (like Kivy, Tkinter, PyQt etc. )<br />\r\n&nbsp;&nbsp; &nbsp;c.Web frameworks like Django (used by YouTube, Instagram, &nbsp;&nbsp; &nbsp;Dropbox)<br />\r\n&nbsp;&nbsp; &nbsp;d.Image processing (like OpenCV, Pillow)<br />\r\n&nbsp;&nbsp; &nbsp;e.Web scraping (like Scrapy, BeautifulSoup, Selenium)<br />\r\n&nbsp;&nbsp; &nbsp;f.Test frameworks<br />\r\n&nbsp;&nbsp; &nbsp;g.Multimedia<br />\r\n&nbsp;&nbsp; &nbsp;h.Scientific computing<br />\r\n&nbsp;&nbsp; &nbsp;i. Text processing and many more..</p>\r\n', 'https://www.youtube.com/embed/rfscVS0vtbw', 'https://www.geeksforgeeks.org/python-language-introduction/', 104),
(11, 'Java Introduction', '<p>Primary/Main Features of Java<br />\r\n1. Platform Independent: &nbsp;Compiler converts source code to bytecode and then the JVM executes the bytecode generated by the compiler. This bytecode can run on any platform be it Windows, Linux, macOS which means if we compile a program on Windows, then we can run it on Linux and vice versa. Each operating system has a different JVM, but the output produced by all the OS is the same after the execution of bytecode. That is why we call java a platform-independent language.</p>\r\n\r\n<p>2. Object-Oriented Programming Language: &nbsp;Organizing the program in the terms of collection of objects is a way of object-oriented programming, each of which represents an instance of the class.<br />\r\nThe four main concepts of Object-Oriented programming are:<br />\r\nAbstraction<br />\r\nEncapsulation<br />\r\nInheritance<br />\r\nPolymorphism</p>\r\n\r\n<p>3. Simple: &nbsp;Java is one of the simple languages as it does not have complex features like pointers, operator overloading, multiple inheritances, Explicit memory allocation.&nbsp;</p>\r\n\r\n<p>4. Robust: &nbsp;Java language is robust which means reliable. It is developed in such a way that it puts a lot of effort into checking errors as early as possible, that is why the java compiler is able to detect even those errors that are not easy to detect by another programming language. The main features of java that make it robust are garbage collection, Exception Handling, and memory allocation.</p>\r\n\r\n<p>5. Secure: &nbsp;In java, we don&rsquo;t have pointers, so we cannot access out-of-bound arrays i.e it shows ArrayIndexOutOfBound Exception if we try to do so. That&rsquo;s why several security flaws like stack corruption or buffer overflow are impossible to exploit in Java. &nbsp; &nbsp;</p>\r\n', 'https://www.youtube.com/embed/mG4NLNZ37y4', 'https://www.geeksforgeeks.org/introduction-to-java/', 105),
(12, 'Java Terminology', '<p>1. &nbsp;Java Virtual Machine(JVM): &nbsp;This is generally referred to as JVM. There are three execution phases of a program. They are written, compile and run the program.</p>\r\n\r\n<p>2. Bytecode in the Development process: &nbsp;As discussed, the Javac compiler of JDK compiles the java source code into bytecode so that it can be executed by JVM. It is saved as .class file by the compiler. To view the bytecode, a disassembler like javap can be used.</p>\r\n\r\n<p>3. Java Development Kit(JDK): While we were using the term JDK when we learn about bytecode and JVM. So, as the name suggests, it is a complete Java development kit that includes everything including compiler, Java Runtime Environment (JRE), java debuggers, java docs, etc. For the program to execute in java, we need to install JDK on our computer in order to create, compile and run the java program.</p>\r\n\r\n<p>4. Java Runtime Environment (JRE): JDK includes JRE. JRE installation on our computers allows the java program to run, however, we cannot compile it. JRE includes a browser, JVM, applet supports, and plugins. For running the java program, a computer needs JRE.</p>\r\n\r\n<p>5. Garbage Collector: In Java, programmers can&rsquo;t delete the objects. To delete or recollect that memory JVM has a program called Garbage Collector. Garbage Collectors can recollect the objects that are not referenced. So Java makes the life of a programmer easy by handling memory management. However, programmers should be careful about their code whether they are using objects that have been used for a long time. Because Garbage cannot recover the memory of objects being referenced.<br />\r\n&nbsp;</p>\r\n', 'https://www.youtube.com/embed/eIrMbAQSU34', 'https://www.geeksforgeeks.org/introduction-to-java/', 105),
(13, 'Javascript introduction', '<p>JavaScript is the world most popular lightweight, interpreted compiled programming language. It is also known as scripting language for web pages. It is well-known for the development of web pages, many non-browser environments also use it. JavaScript can be used for Client-side developments as well as Server-side developments.</p>\r\n\r\n<p>1.Client-side: It supplies objects to control a browser and its Document Object Model (DOM). Like if client-side extensions allow an application to place elements on an HTML form and respond to user events such as mouse clicks, form input, and page navigation. Useful libraries for the client-side are AngularJS, ReactJS, VueJS and so many others.</p>\r\n\r\n<p>2.Server-side: It supplies objects relevant to running JavaScript on a server. Like if the server-side extensions allow an application to communicate with a database, and provide continuity of information from one invocation to another of the application, or perform file manipulations on a server. The useful framework which is the most famous these days is node.js.<br />\r\nJavaScript can be added to your HTML file in two ways:</p>\r\n\r\n<p>1. Internal JS: We can add JavaScript directly to our HTML file by writing the code inside the &lt;script&gt; tag. The &lt;script&gt; tag can either be placed inside the &lt;head&gt; or the &lt;body&gt; tag according to the requirement.<br />\r\n2. External JS: We can write JavaScript code in other file having an extension .js and then link this file inside the &lt;head&gt; tag of the HTML file in which we want to add this code.</p>\r\n', 'https://www.youtube.com/embed/Ia0FSogTRaw', 'https://www.geeksforgeeks.org/introduction-to-javascript/', 106),
(14, 'Learning JavaScript Full Course', '<p>Applications of JavaScript:&nbsp;<br />\r\n&nbsp;<br />\r\nWeb Development: Adding interactivity and behavior to static sites JavaScript was invented to do this in 1995. By using AngularJS that can be achieved so easily.</p>\r\n\r\n<p>Web Applications: With technology, browsers have improved to the extent that a language was required to create robust web applications. When we explore a map in Google Maps then we only need to click and drag the mouse. All detailed view is just a click away, and this is possible only because of JavaScript. It uses Application Programming Interfaces(APIs) that provide extra power to the code. The Electron and React is helpful in this department.</p>\r\n\r\n<p>Server Applications: With the help of Node.js, JavaScript made its way from client to server and node.js is the most powerful on the server-side.</p>\r\n\r\n<p>Games: Not only in websites, but JavaScript also helps in creating games for leisure. The combination of JavaScript and HTML 5 makes JavaScript popular in game development as well. It provides the EaseJS library which provides solutions for working with rich graphics.</p>\r\n\r\n<p>Smartwatches: JavaScript is being used in all possible devices and applications. It provides a library PebbleJS which is used in smartwatch applications. This framework works for applications that require the internet for its functioning.</p>\r\n\r\n<p>Art: Artists and designers can create whatever they want using JavaScript to draw on HTML 5 canvas, make the sound more effective also can be used p5.js library.</p>\r\n\r\n<p>Machine Learning: This JavaScript ml5.js library can be used in web development by using machine learning.</p>\r\n', 'https://www.youtube.com/embed/PkZNo7MFNFg', 'https://www.geeksforgeeks.org/introduction-to-javascript/', 106);

